import React, { useEffect } from 'react';
import useDaoTraductorData from './useDaoTraductorData';

const DaoTraductorRow = ({ TraductorIndex, onDataChange }) => {
  const datos = useDaoTraductorData(TraductorIndex);

  useEffect(() => {
    if (datos) {
      onDataChange(TraductorIndex, datos);
    }
  }, [TraductorIndex, datos, onDataChange]);

  return (
    <tr key={'TRA-' + TraductorIndex}>
      <td>{datos}</td>
    </tr>
  );
};

export default DaoTraductorRow;
